"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWHITLOCK Valerie Dawn (Val). On August 11, 2005 peacefully at her home after a long illness borne with great courage. Darling wife, companion and soulmate of Mike. Loved friend, mother and motherinlaw of Tracey and Allan, Binny and Brian, Shelley and Bill. Loved grandma of Taylor, Matt, Caitlin, MacKenzie, Oscar and Stevie. A great spirit now free to soar. A service for Val will be held at the Edgar Faber Memorial Chapel, Roskill Masonic Village, 42 Herd Rd, Hillsborough on Monday August 15 at 2pm to be followed by a private cremation. In lieu of flowers, donations to St Joseph's Mercy Hospice PO Box 9911, Newmarket would be appreciated. All communications to PO Box 28272 Remuera. Davis Funerals Mt Eden FDANZ Griefcare\n</p>\n</div>\n</div>",
