"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWon DCM, M H Irvine Dies\n</p>\n<p>\nMorris Horton Irvine, 216 7th Avenue South dies in a local hostpital at the age of 68, after a short illness.\n</p>\n<p>\nBorn in Innellan, Scotland, Mr Irvine came to Lethbridge in 1907 and worked as a messenger for the Bank of Montreal until he retired in 1948. He served overseas with the 35th Battery, receiving the DCM. he was a past President of the Army and Navy Veterans Club, and a member of the Royal Canadian Legion.\n</p>\n<p>\nHe is survived by a son Herbert Coronation; a daughter Mrs Ethel C Reid, Lethbridge; and 15 great-grandchildren. he was predeceased by his wife the former Mary Walker in 1952, and a son Andrew in 1956.\n</p>\n<p>\nFuneral service will be held at St Andrews Presbyterian Church at 1:20 pm on Firday.\n</p>\n</div>\n</div>",
