"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nA private family graveside service will be held for Stella R. Skare, 95, of Junction City, at Fort Riley Cemetery. No visitation is planned. Mrs. Skare passed away on Friday, Nov. 14, 2008, at Geary Community Hospital.\n</p>\n<p>\nMrs. Skare was born July 9, 1913, in Colchester, England, to Arthur W. and Gertrude (Riddleston) Woolsey. She married Henry Leonard Skare April 28, 1946, in England. They moved to Junction City in 1952 where she was a homemaker. She loved to play the organ and loved to cook. She really enjoyed her garden of beautiful flowers as well as nature alone and she was well known for her knitting.\n</p>\n<p>\nShe is survived by two sons, Harold Critchlow of Burton on Trent, England, and John Skare of Junction City; two daughters, Beverly Torre and Sheila and husband, Roy, Fausnett, all of Junction City; one brother, Keith Woolsey of England; four sisters, Cynthia Russell, Barbara Whitaker, Margaret and husband, James, Jowers and Rose Dickson, all of Colchester, England; six grandchildren, eight great-grandchildren and five great-great-grandchildren.\n</p>\n<p>\nShe was preceded in death by her parents, her husband, Henry, on Feb. 2, 1971; one sister, Gertrude Budd; and three brothers, Wilford, Stanley and Cyril Woolsey.\n</p>\n<p>\nMemorial contributions may be given to the First United Methodist Church, 804 N. Jefferson St., Junction City, KS 66441. Penwell-Gabel Johnson Chapel is assisting the family with arrangements.\n</p>\n</div>\n</div>",
